import React from "react";
import componentStyle from "./index.module.css";
import ArrowBtn from "./component/ArrowBtn";

export default class MainModule extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      containerState: {
        first: {
          zIndex: 3,
          rotateY: 0,
        },
        second: {
          zIndex: 2,
          rotateY: -72,
        },
      },
    };
  }
  render() {
    return (
      <div>
        <div
          className={`${componentStyle.container} ${componentStyle.first}`}
        ></div>
        <div
          className={`${componentStyle.container} ${componentStyle.second}`}
        ></div>
        <div
          className={`${componentStyle.container} ${componentStyle.third}`}
        ></div>
        <div
          className={`${componentStyle.container} ${componentStyle.forth}`}
        ></div>
        <div
          className={`${componentStyle.container} ${componentStyle.fifth}`}
        ></div>
        <div className={componentStyle.leftArrowBtn}>
          <ArrowBtn />
        </div>
        <div className={componentStyle.rightArrowBtn}>
          <ArrowBtn />
        </div>
      </div>
    );
  }
}
